import React from "react";

import Navbar from "../../components/navbar";
import SocialLinks from "../../components/socialLinks";
import Body from "../../components/body";

import { Typography, Grid } from "@material-ui/core";

import withStyles from "./styles";

class About extends React.Component {
  renderSocialLinks = () => {
    const { classes } = this.props;
    return (
      <div className={classes.socialLinkContainer}>
        <SocialLinks />
      </div>
    );
  };

  render() {
    const { classes } = this.props;
    return (
      <div>
        <Navbar />
        <Body>
          {this.renderSocialLinks()}
          <Grid
            container
            direction="column"
            justify="center"
            alignContent="center"
          >
            <div className={classes.container}>
              <Grid item={12} direction="row">
                <Typography
                  variant="headline"
                  inline={true}
                  className={classes.number}
                >
                  01.
                </Typography>
                <Typography
                  variant="headline"
                  inline={true}
                  className={classes.pageTitle}
                >
                  About
                </Typography>
              </Grid>
              <Grid container>
                <Grid item xs={6} className={classes.paraContainer}>
                  <Typography className={classes.para}>
                    My name is Drew Blincoe and I am a Software Developer out of
                    Evansville, IN.{" "}
                  </Typography>
                </Grid>
                <Grid item xs={6} className={classes.imgContainer}>
                  <img
                    src={"/static/professional.jpg"}
                    className={classes.img}
                  />
                </Grid>
              </Grid>
            </div>
          </Grid>
        </Body>
      </div>
    );
  }
}

export default withStyles(About);
